import React from 'react';
import { connect } from 'react-redux';

class SavedQueries extends React.Component {

    render() {
        return (
            <div className="savedQueries">
                <h1>Saved Queries</h1>
                <ul>
                    {this.props.savedQueries.map((name, index) => <li on key={index}>{name}</li>)}
                </ul>
            </div>
        )
    }
}

const mapStateToProps = state => ({
    savedQueries: state.savedQueries.queries
  })

export default connect(mapStateToProps, null)(SavedQueries);
